import {
  repeaterData,
  RepeaterControl,
} from '../../../gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls, InnerBlocks } = wp.blockEditor;
const { useState } = wp.element;
const {
  PanelBody,
  PanelRow,
  ToggleControl,
  TextControl,
  TextareaControl,
  RadioControl,
  CheckboxControl
} = wp.components;


const year = new Date().getFullYear();

registerBlockType("gb/gb4columnwithnewsletterandlocalizationdark", {
  title: __("4 Column With Newsletter and Localization Dark", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "footer",
  attributes: {
    method: {
      type: "string",
      default: "GET",
    },
    action: {
      type: "string",
      default: "",
    },
    hidden: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    currencies: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "currencies",
      default: [],
    },
    languages: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "languages",
      default: [],
    },
    menusMarkup:{
      type: "string",
      default: "",
    },
    contentVN: { type: "string", default: `Footer` },
    contentUU: { type: "string", default: `Language &amp; Currency` },
    contentUV: { type: "string", default: `Language` },
    contentVK: { type: "string", default: `Subscribe to our newsletter` },
    contentVL: {
      type: "string",
      default: `The latest news, articles, and resources, sent to your inbox weekly.`,
    },
    contentVM: { type: "string", default: `Email address` },
    contentt: { type: "string", default: `Subscribe` },
    contentVT: {
      type: "string",
      default: `&copy; ${year} Workflow, Inc. All rights reserved.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const { send } = attributes;
    const [to, setTo] = useState('');
    const [message, setMessage] = useState('');
    const [subject, setSubject] = useState('');
    const [ menus, setMenus ] = useState( [] );
    const [ availableMenus, setAvailabelMenus ] = useState( [] );
    const { subscribe } = wp.data;

    const arData = repeaterData(props.attributes.currencies, true);
    const languages = repeaterData(props.attributes.languages, true);

    const closeListener = subscribe( () => {
      const isReady =  !!wp.data.select('core').getMenus() && !!wp.data.select('core').getMenuItems();
      if ( ! isReady ) {
        return;
      }

      setAvailabelMenus(wp.data.select('core').getMenus().map((b) => {
        let menuHTML = '';

        menuHTML += `<h3 class="text-sm font-semibold text-gray-400 tracking-wider uppercase">${b.name}</h3><ul role="list" class="mt-4 space-y-4">`;
        wp.data.select('core').getMenuItems().map((item) => {  
          
          if (b.id === item.menus) {
            menuHTML += `<li><a href="${item.url}" class="text-base text-gray-300 hover:text-white">${item.title.raw}</a></li>`
          }

        });
       
        menuHTML += '</ul>';

        closeListener();
        return { id: b.id, name: b.name, markup: menuHTML }

      }));
    });

    const handleChangeGroup = (selectedItem) => {
      let temp  = [];
      if (menus.includes(selectedItem)) {
          const tempArray = menus.filter(item => item !== selectedItem);
          temp = [...tempArray];
      } else {
          temp = [...menus, selectedItem];
      }

      showMenus(selectedItem, temp);

      setMenus(temp);

      return temp;
    };

    const showMenus = (selectedItem, temp) => {
      let cont = 0;
      let markup = '';

      temp.map((a)=> {

        if (cont % 2 === 0) {
          markup += '<div class="md:grid md:grid-cols-2 md:gap-8"><div>';
        } else {
          markup += '<div class="mt-12 md:mt-0">';
        }

        markup += availableMenus.filter(obj => obj.id === a)[0].markup;

        if ((cont % 2 !== 0)) {
          markup += '</div></div>';
        } else {
          markup += '</div>';
        }

        if (cont === menus.length){
          markup += '</div>';
        }

        cont++;

        return markup;
    })
      setAttributes({menusMarkup: markup});

      return markup;
    }

    return (
      <footer className="bg-gray-800" aria-labelledby="footer-heading">
        <InspectorControls>
        <PanelBody title="Block settings">
        <PanelRow>
              <b>Languages</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={30}
                value={props.attributes.languages}
                onChange={(val) => {
                  props.setAttributes({ languages: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Symbol"
                      value={value.symbol}
                      onChange={(v) => {
                        value.symbol = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Label"
                      value={value.label}
                      onChange={(v) => {
                        value.label = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
            <PanelRow>
              <b>Currencies</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={10}
                value={props.attributes.currencies}
                onChange={(val) => {
                  props.setAttributes({ currencies: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Symbol"
                      value={value.symbol}
                      onChange={(v) => {
                        value.symbol = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Label"
                      value={value.label}
                      onChange={(v) => {
                        value.label = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
          <PanelBody title="Menus">
              { availableMenus.map(function(k) {        

                  return <PanelRow>
                            <CheckboxControl

                              label={ k.name }
                              value={k.id}
                              checked={menus.includes(k.id)}
                              onChange={ () => handleChangeGroup(k.id)}
                            />
                          
                          </PanelRow>
                         
                })}           
            
          </PanelBody>
          <PanelBody title="Email settings">
            <PanelRow>
              <ToggleControl
                label="Send email"
                checked={send}
                onChange={() => setAttributes({ send: !send })}
              />
            </PanelRow>
            {send ? (
              <div>
                <PanelRow>
                  <TextControl
                    label="To"
                    value={to}
                    onChange={(to) => setTo(to)}
                  />
                </PanelRow>
                <PanelRow>
                  <TextControl
                    label="Subject"
                    value={subject}
                    onChange={(subject) => setSubject(subject)}
                  />
                </PanelRow>
                <PanelRow>
                  <TextareaControl
                    label="Message"
                    value={message}
                    help="Input names within curly brackets will be parsed."
                    onChange={(message) => setMessage(message)}
                  />
                </PanelRow>
              </div>
            ) : (
              ""
            )}
          </PanelBody>
          <PanelBody title="Form settings">
            <PanelRow>
              <RadioControl
                label="Method"
                selected={attributes.method}
                options={[
                  { label: "GET", value: "GET" },
                  { label: "POST", value: "POST" },
                ]}
                onChange={(method) => setAttributes({ method })}
              />
            </PanelRow>
            <PanelRow>
              <TextControl
                label="Action"
                onChange={(action) => setAttributes({ action })}
              />
            </PanelRow>

            <PanelRow>
              <b>Hidden fields</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={5}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Name"
                      value={value.name}
                      onChange={(v) => {
                        value.name = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Value"
                      value={value.val}
                      onChange={(v) => {
                        value.val = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <h2 id="footer-heading" className="sr-only">
          <RichText
            value={attributes.contentVN}
            default={"Footer"}
            onChange={(newtext) => setAttributes({ contentVN: newtext })}
          />
        </h2>
        <div className="max-w-7xl mx-auto py-12 px-4 sm:px-6 lg:py-16 lg:px-8">
          
          <div className="pb-8 xl:grid xl:grid-cols-5 xl:gap-8 menus-wrapper">
            {wp.element.RawHTML( { children: attributes.menusMarkup})}
            <div className="mt-12 xl:mt-0">
              
              <h3 className="text-sm font-semibold text-gray-400 tracking-wider uppercase">
                <RichText
                  value={attributes.contentUU}
                  default={"Language &amp; Currency"}
                  onChange={(newtext) =>
                    setAttributes({ contentUU: newtext })
                  }
                />
              </h3>
              <form className="mt-4 sm:max-w-xs">
                
                <fieldset className="w-full">
                  
                  <label for="language" className="sr-only">
                    <RichText
                      value={attributes.contentUV}
                      default={"Language"}
                      onChange={(newtext) =>
                        setAttributes({ contentUV: newtext })
                      }
                    />
                  </label>
                  <div className="relative">
                    
                    <select
                      id="language"
                      name="language"
                      className="appearance-none block w-full bg-none bg-gray-700 border border-transparent rounded-md py-2 pl-3 pr-10 text-base text-white focus:outline-none focus:ring-white focus:border-white sm:text-sm"
                    >
                      {languages.map((v) => {
                        return <option value={v.symbol}>{v.label}</option>
                      })}
                      
                    </select>
                    <div className="pointer-events-none absolute inset-y-0 right-0 px-2 flex items-center">
                      
                      <svg
                        className="h-4 w-4 text-white"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 20 20"
                        fill="currentColor"
                        aria-hidden="true"
                      >
                        
                        <path
                          fill-rule="evenodd"
                          d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        />
                      </svg>
                    </div>
                  </div>
                </fieldset>
                <fieldset className="mt-4 w-full">
                  
                  <label for="currency" className="sr-only">
                    <RichText
                      value={attributes.contentVB}
                      default={"Currency"}
                      onChange={(newtext) =>
                        setAttributes({ contentVB: newtext })
                      }
                    />
                  </label>
                  <div className="mt-1.5 relative">
                    
                    <select
                      id="currency"
                      name="currency"
                      className="appearance-none w-full bg-none bg-gray-700 border border-transparent rounded-md block py-2 pl-3 pr-10 text-base text-white focus:outline-none focus:ring-white focus:border-white sm:text-sm"
                    >
                      
                      
                    </select>
                    <div className="pointer-events-none absolute inset-y-0 right-0 px-2 flex items-center">
                      
                      <svg
                        className="h-4 w-4 text-white"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 20 20"
                        fill="currentColor"
                        aria-hidden="true"
                      >
                        
                        <path
                          fill-rule="evenodd"
                          d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        />
                      </svg>
                    </div>
                  </div>
                </fieldset>
              </form>
            </div>
          </div>
          <div className="border-t border-gray-700 pt-8 lg:flex lg:items-center lg:justify-between xl:mt-0">
            
            <div>
              
              <h3 className="text-sm font-semibold text-gray-400 tracking-wider uppercase">
                <RichText
                  value={attributes.contentVK}
                  default={"Subscribe to our newsletter"}
                  onChange={(newtext) =>
                    setAttributes({ contentVK: newtext })
                  }
                />
              </h3>
              <p className="mt-2 text-base text-gray-300">
                <RichText
                  value={attributes.contentVL}
                  default={
                    "The latest news, articles, and resources, sent to your inbox weekly."
                  }
                  onChange={(newtext) =>
                    setAttributes({ contentVL: newtext })
                  }
                />
              </p>
            </div>
            <form className="mt-4 sm:flex sm:max-w-md lg:mt-0">
              
              <label for="email-address" className="sr-only">
                <RichText
                  value={attributes.contentVM}
                  default={"Email address"}
                  onChange={(newtext) =>
                    setAttributes({ contentVM: newtext })
                  }
                />
              </label>
              <input
                type="email"
                name="email-address"
                id="email-address"
                autocomplete="email"
                required
                className="appearance-none min-w-0 w-full bg-white border border-transparent rounded-md py-2 px-4 text-base text-gray-900 placeholder-gray-500 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-white focus:border-white focus:placeholder-gray-400 sm:max-w-xs"
                placeholder="Enter your email"
              />
              <div className="mt-3 rounded-md sm:mt-0 sm:ml-3 sm:flex-shrink-0">
                
                <button
                  type="submit"
                  className="w-full bg-indigo-500 border border-transparent rounded-md py-2 px-4 flex items-center justify-center text-base font-medium text-white hover:bg-indigo-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-indigo-500"
                >
                  <RichText
                    value={attributes.contentt}
                    default={"Subscribe"}
                    onChange={(newtext) =>
                      setAttributes({ contentt: newtext })
                    }
                  />
                </button>
              </div>
            </form>
          </div>
          <div className="mt-8 border-t border-gray-700 pt-8 md:flex md:items-center md:justify-between">
            <div className="flex space-x-6 md:order-2">
              <InnerBlocks
                allowedBlocks={["core/social-links"]}
                template={[["core/social-links"]]} templateLock="all"
              />
            </div>
            <p className="mt-8 text-base text-gray-400 md:mt-0 md:order-1">
              <RichText
                value={attributes.contentVT}
                onChange={(newtext) => setAttributes({ contentVT: newtext })}
              />
            </p>
          </div>
        </div>
      </footer>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.currencies, true);
    const languages = repeaterData(props.attributes.languages, true);

    return (
      <footer class="bg-gray-800" aria-labelledby="footer-heading">
        
        <h2 id="footer-heading" class="sr-only">
         <RichText.Content value={attributes.contentVN}/>
        </h2>
        <div class="max-w-7xl mx-auto py-12 px-4 sm:px-6 lg:py-16 lg:px-8">
          
          <div class="pb-8 xl:grid xl:grid-cols-5 xl:gap-8 menus-wrapper">  
            {wp.element.RawHTML( { children: attributes.menusMarkup})}
            <div class="mt-12 xl:mt-0">
              
              <h3 class="text-sm font-semibold text-gray-400 tracking-wider uppercase">
               <RichText.Content value={attributes.contentUU}/>
              </h3>
              <form class="mt-4 sm:max-w-xs">
                
                <fieldset class="w-full">
                  
                  <label for="language" class="sr-only">
                   <RichText.Content value={attributes.contentUV}/>
                  </label>
                  <div class="relative">
                    
                    <select
                      id="language"
                      name="language"
                      class="appearance-none block w-full bg-none bg-gray-700 border border-transparent rounded-md py-2 pl-3 pr-10 text-base text-white focus:outline-none focus:ring-white focus:border-white sm:text-sm"
                    >
                      
                      {languages.map((v) => {
                        return (
                          <option value={v.symbol}>
                              {v.label}
                          </option>
                        )
                      })}
                    </select>
                    <div class="pointer-events-none absolute inset-y-0 right-0 px-2 flex items-center">
                      
                      <svg
                        class="h-4 w-4 text-white"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 20 20"
                        fill="currentColor"
                        aria-hidden="true"
                      >
                        
                        <path
                          fill-rule="evenodd"
                          d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        />
                      </svg>
                    </div>
                  </div>
                </fieldset>
                <fieldset class="mt-4 w-full">
                  
                  <label for="currency" class="sr-only">
                   <RichText.Content value={attributes.contentVB}/>
                  </label>
                  <div class="mt-1.5 relative">
                    
                    <select
                      id="currency"
                      name="currency"
                      class="appearance-none w-full bg-none bg-gray-700 border border-transparent rounded-md block py-2 pl-3 pr-10 text-base text-white focus:outline-none focus:ring-white focus:border-white sm:text-sm"
                    >
                      {arData.map((v) => {
                        return (
                          <option value={v.symbol}>
                              {v.label}
                          </option>
                        )
                      })}
                    </select>
                    <div class="pointer-events-none absolute inset-y-0 right-0 px-2 flex items-center">
                      
                      <svg
                        class="h-4 w-4 text-white"
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 20 20"
                        fill="currentColor"
                        aria-hidden="true"
                      >
                        
                        <path
                          fill-rule="evenodd"
                          d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        />
                      </svg>
                    </div>
                  </div>
                </fieldset>
              </form>
            </div>
          </div>
          <div class="border-t border-gray-700 pt-8 lg:flex lg:items-center lg:justify-between xl:mt-0">
            
            <div>
              
              <h3 class="text-sm font-semibold text-gray-400 tracking-wider uppercase">
               <RichText.Content value={attributes.contentVK}/>
              </h3>
              <p class="mt-2 text-base text-gray-300">
               <RichText.Content value={attributes.contentVL}/>
              </p>
            </div>
            <form class="mt-4 sm:flex sm:max-w-md lg:mt-0">
              
              <label for="email-address" class="sr-only">
               <RichText.Content value={attributes.contentVM}/>
              </label>
              <input
                type="email"
                name="email-address"
                id="email-address"
                autocomplete="email"
                required
                class="appearance-none min-w-0 w-full bg-white border border-transparent rounded-md py-2 px-4 text-base text-gray-900 placeholder-gray-500 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-white focus:border-white focus:placeholder-gray-400 sm:max-w-xs"
                placeholder="Enter your email"
              />
              <div class="mt-3 rounded-md sm:mt-0 sm:ml-3 sm:flex-shrink-0">
                
                <button
                  type="submit"
                  class="w-full bg-indigo-500 border border-transparent rounded-md py-2 px-4 flex items-center justify-center text-base font-medium text-white hover:bg-indigo-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-indigo-500"
                >
                 <RichText.Content value={attributes.contentt}/>
                </button>
              </div>
            </form>
          </div>
          <div class="mt-8 border-t border-gray-700 pt-8 md:flex md:items-center md:justify-between">
            
            <div class="flex space-x-6 md:order-2">
              <InnerBlocks.Content/>
            </div>
            <p class="mt-8 text-base text-gray-400 md:mt-0 md:order-1">
             <RichText.Content value={attributes.contentVT}/>
            </p>
          </div>
        </div>
      </footer>
    );
  },
});
